import React from 'react';
import './Project.css';

function Project({
    headLine, projectLink
}) {
    return (
        <>
            <div className='project-container'>
                <h1>{headLine}</h1>
                <h1 className="project-link-text">project show page coming soon</h1>
            </div>

        </>
    )
}

export default Project;
